import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "../css/searchstyle.css";

class Buy extends Component {
  state = {};

  buySearchButtonClick = () => {
    window.location.href = "/buy";
  };

  addBuyButtonClick = () => {
    window.location.href = "/newbuy";
  };

  render() {
    return (
      <div class="container">

  <header>
    <h2><a href="#"><i class="ion-plane"></i> BLINK EXCHANGE</a></h2>
    <nav>
      <ul>
        <li>
          <a href="sell.html" title="Sell">Sell</a>
        </li>

        <li>
          <a href="index.html" title="Return to HOME Page">Return to Home Page</a>
        </li>
        <li>
         <a href="#" title="LOG OUT">LOG OUT</a>
        </li>
      </ul>
    </nav>
  </header>

</div>
    );
  }
}

export default Buy;
